sys_variable_value.value:
(function execute(inputs, outputs) {
    var gfs = new GoogleCloudFunctionsUtils();
    gfs.validateInputVariables(inputs, outputs);
    gfs.validateMandatoryVariables(inputs, ['projectid', 'location', 'function']);
    gfs.maptoOutputFromInput(inputs, outputs, []);
})(inputs, outputs);

